'Action Commissions feature allows you to define per action, or per "anything" commissions.<br/>This way you can define commissions for example per user registration, per download, per visiting specific page, etc.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Екстрата за добавяне на комисиони за действие Ви позволява са дефинирате комисионни за всякакво действие или за "каквото се сетите".<br/>По този начин можете да определите комисионни за например: регистрация на потребители, за сваляне на файлове, за посещаване на специфична страница и др..<br/><a href="%s" target="_blank">Повече помощ в Базата знания...</a>',
'More help in our Knowledge Base'=>'Повече помощ в Базата знания...',
'Banner rotator is a special type of banner that rotates other banners.<br/>When affiliate inserts rotator to his page, the rotator displays banners that are assigned to the rotator, so the visitor will see another banner every time he visits the affiliates page.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Банер ротатора е специален тип банер, който показва други банери.<br/>Когато партньорът показва банери включени в ротатор, то посетителят на страницата ще вижда различен банер при всяко посещение на страницата.<br/><a href="%s" target="_blank">Повече помощ в Базата знания...</a>',
'Branding free'=>'Branding FREE',
'Branding Free is a special feature that allows you to change the links in the footer of panels and signup form from "Powered by %s" to your own text and link.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Branding FREE е специална екстра, която позволява да промените линковете във футъра на панела за управление на партньорите и формуляра за регистрация. Ще можете да промените от "Powered by %s" на определен от вас текст и/или линк.<br/><a href="%s" target="_blank">Повече помощ в Базата знания...</a>',
'Commission Groups'=>'Комисионни групи',
'Commission groups allow you to set different commissions for different users for the same campaign.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Групите за комисионни Ви позволяват да задавате различни комисионни за различни потребители в рамките на една и съща кампания.<br/><a href="%s" target="_blank">Повече помощ в Базата знания...</a>',
'CPM commissions'=>'CPM комисионни',
'CPM (cost per mille) commissions are a special type of commissions that are rewarded for 1000 impressions, which means for displaying your banners 1000 times.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Комисионните за  показване [CPM (cost per mille)] са специален тип комисиони, които се дават за всеки 1000 импресии.<br/><a href="%s" target="_blank">Повече помощ в Базата знания...</a>',
'Forced matrix allows you to limit to the number of referrals of subaffiliates any affiliate can refer. It means that every affiliate can have only specified number of children. <a href="%s" target="_blank">More details read in our Knowledge Base</a>'=>'Forced matrix позволява да ограничите броя на дъщерните партньори, които всеки партньор може да има. Това задава максималният брой. <a href="%s" target="_blank">Повече помощ в Базата знания</a>',
'Hosting of %s on  %s servers.'=>'Хостинг на %s на  %s сървъра.',
'Multiple currencies allow you to track sales in multiple currencies.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Множеството валути позволяват трасирането на продажбите в различни валути.<br/><a href="%s" target="_blank">Повече помощ в Базата знания...</a>',
'Multiple merchants'=>'Няколко търговеца',
'By default, all campaigns in %s are public, which means that all affiliates can view and promote them. Private campaigns feature allows you to create private campaigns, which will be visible only to selected affiliates.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'По подразбиране всички кампании в %s са публични, което означава, че всички партньори могат да ги виждат и да ги промотират. Скритите кампании позволяват да създавате кампании, които да са видими за избрани партньори.<br/><a href="%s" target="_blank">Повече помощ в Базата знания...</a>',
'It alows you to create a special type of promo materials - rebrandable e-books. You can create your PDF e-book only once and upload it to %s.Your affiliates will automatically get their own re-branded copy of the book, with their name, affiliate links, texts, etc. There is no need to run any Windows program for branding, they will simply download rebranded PDF. All the rebranding is made automatically in the background.<br/><a href="%s" target="_blank">%s</a>'=>'Позволява ви да създавате специален тип промо материали – ребрендирани електронни книги. Можете да създавате собствени PDF e-book веднъж и да ги качите в %s. Вашите партньори ще могат да изтеглят свои собствени ребрендирани копия на файла, със заменени имена, линкове, текстове и др. Няма да има нужда от никаква Windows или Мас програма за брендиране, те просто ще трябва да свалят ребрендираният PDF файл. Цялата работа по ребрендирането се извършва като фонова задача.<br/><a href="%s" target="_blank">%s</a>',
'Recurring commissions allow you to reward your affiliates for recurring payments, for example for hosting or membership. <br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Периодичните комисионни позволяват да плащате на вашите партньори за периодични плащания, като например хостинг услуги или някакво членство. <br/><a href="%s" target="_blank">Повече помощ в Базата знания</a>',
