'Refid format'=>'Refid формат',
'It is possible to use following values in ID: {9} - will be replaced by any character in range [0-9], {z} - will be replaced by any character in range [a-z], {Z} - will be replaced by any character in range [A-Z], {X} - will be replaced by any character in range [0-9a-zA-Z], all other characters will be copied to refid as you will specify in format. Example of good format is e.g. {ZZZ}-{XXXXX}-{999}'=>'Възможно е да се използват следните стойности в ID: {9} - ще бъде заменен с някоя цифра в диапазона [0-9], {z} - ще бъде заменен с някой символ в диапазона [a-z], {Z} - ще бъде заменен с някой символ в диапазона [A-Z], {X} - ще бъде заменен с някой символ в диапазона [0-9 a-z A-Z], всички други символи ще бъдат копирани в refid така както сте определили във формата. Пример за добър формат е например  {ZZZ}-{XXXXX}-{999}',
'Refid format saved'=>'Refid формата е запазен',
'Refid must be in format "%s". Format definition: {9} - will be replaced by any character in range [0-9], {z} - will be replaced by any character in range [a-z], {Z} - will be replaced by any character in range [A-Z], {X} - will be replaced by any character in range [0-9a-zA-Z], all other characters will be unchanged. Example of good format is e.g. {ZZZ}-{XXXXX}-{999}'=>'Refid трабва да бъде във формат "%s". Описание на формата: {9} - ще бъде заменено от някоя цифра в диапазона [0-9], {z} - ще бъде заменено с някой символ в диапазона [a-z], {Z} - ще бъде заменено с някой символ в диапазона [A-Z], {X} - ще бъде заменено с някой символ в диапазона  [0-9a-zA-Z], всички друи символи ще бъдат незасегнати. Пример за добър формат е {ZZZ}-{XXXXX}-{999}',
'Custom refid'=>'Собствен refid',
